import React, { Component } from 'react'
import styles from '../DashBoardCss/DashBoardCss.css'
export default class DashboardCss extends Component {
    render() {
        return (
            <div>
                
            <div className={styles.container}>
                <p className={styles.content}>Css from dashboard</p>
            </div>
            </div>
        )
    }
}
